import React from "react";
import "./ss";

const GoogleSignup = () => {
  return (
    <div className="google-signup-container">
      <div className="signup-box">
        <img
          src="https://ssl.gstatic.com/accounts/ui/avatar_2x.png"
          alt="Profile Icon"
          className="profile-icon"
        />
        <h1>Create your Google Account</h1>
        <div>
          <div className="input-group">
            <input
              type="text"
              placeholder="First name"
              defaultValue="Superman"
            />
            <input
              type="text"
              placeholder="Last name"
              defaultValue="Batman"
            />
          </div>
          <input
            type="text"
            placeholder="Username"
            defaultValue="supermanbatman1023"
          />
          <p className="info-text">Use my current email address instead</p>
          <input type="password" placeholder="Password" />
          <input type="password" placeholder="Confirm" />
          <p className="info-text">
            Use 8 or more characters with a mix of letters, numbers & symbols
          </p>
          <button className="action-button">Next</button>
          <p className="info-text">Sign in instead</p>
        </div>
      </div>
      <div className="footer-links">
        <p>Help</p>
        <p>Privacy</p>
        <p>Terms</p>
      </div>
    </div>
  );
};

export default GoogleSignup;
